import orderList from '@/views/mobile/Order.vue'
import tableList from '@/views/mobile/TableList.vue'
import { listData } from '@/mixins/listData.js' 
export default {
	components: {
		orderList,
		tableList
	},
	mixins:[listData],

	methods: {
		transTab(id){
			this.tabIndex = id;
			this.changeTab();
		},

		startTimeChange(time) {//开始时间改变
			this.startTime = this.$moment(time).format('YYYY-MM-DD HH:mm:ss');
		},

		endTimeChange(time) {
			this.endTime = this.$moment(time).set('hour',23).set('minutes', 59).set('seconds',59).format('YYYY-MM-DD HH:mm:ss');
		},

		draw() { //画箭头
			this.size = this.$refs.dateTemplate.offsetHeight;
			let canvas = document.getElementById('canvas');
			canvas.width = this.size;
			canvas.height = this.size;
			let ctx = canvas.getContext('2d');
			ctx.beginPath();
			ctx.moveTo(this.size / 4 + 6.25, 0);
			ctx.lineTo(this.size / 2 + 6.25, this.size / 2);
			ctx.lineTo(this.size / 4 + 6.25, this.size);
			ctx.lineWidth = 1;
			ctx.strokeStyle = '#66BB6A';
			ctx.stroke();

		},


	},
	mounted() {
		this.draw(); //画箭头
	}
}
